import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
	background: #000;
	padding-top: 21px;
`;

const Video = styled.video`
	height: 720px;
	width: 1280px;
	background: #0b0102;
`;





const watch = (props) => (
	<Container>
		<Video src="assets/video/jbl-xtreme-2.mp4" controls />
	</Container>
)

export default watch;
